import './App.css';
import JobList from './JobList';  // Importa a lista de jobs
import JobForm from './JobForm';  // Importa o formulário de criação/edição

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>Job Management</h1>
        {/* Componente para listar os jobs */}
        <JobList />
        {/* Componente para criar/editar jobs */}
        <JobForm />
      </header>
    </div>
  );
}

export default App;
